import React from 'react'

export default class People extends React.Component {

    render() {
        const people = this.props.people
        const { peoplePos } = this.props

        console.log(Array.isArray(people))
        console.log("people: ", Object.keys(people))

        return (
            <div>
                <h3>Waiting List</h3>
                <ul>{Object.keys(people).forEach((person, i) => {
                    people.push(
                        <li key={i}>{person.name}</li>
                    )
                })}
                </ul>

                <p>
                    {peoplePos === 0 ? "It's your turn to pick a pet!" : (peoplePos !== null ? `Your peoplePos in the Queue is ${peoplePos + 1}` : '')}
                </p>
            </div>
        )
    }
}
